import styled from 'styled-components'

function Inmueble (props) {
    return (
        <div className='inmueble'>
        <h1> {props.titulo} </h1>
        <p>{props.subtitulo}</p>
        <img src={props.imagenInmueble}></img>
        <br></br>
        <a href='/'>Comprar</a>
    </div> 
    )
}

export default Inmueble

const inmueble = styled.inmueble `
    h1 {
        font-weight: 300px;
        color: red !important;
    }
    `
